import React, {Component} from 'react';



class Path extends Component {
	constructor(props){
		super(props)
		this.fetchPathData = this.fetchPathData.bind(this)
		this.state = {
			data :this.props
		}
	}

	componentDidMount(){
	}

	async fetchPathData (params)  {
		let start = 1603971032
		let end = 1608230858
		let dbId = params
		let bodyData = {'params': { 
						'stime': start,
						'etime': end,
						'dbId' : dbId}
					}
		const makeRequest = await fetch('/path', {
	        method: 'POST',
	        body: JSON.stringify(bodyData),
	        headers: {'Content-Type': 'application/json'}
	    })
		const getPathData = await makeRequest.json()
		console.log(getPathData)
		return 'Done'
	}
	render(){
		const {data} = this.state.data
		return (
			<div>
				<button onClick={() => this.fetchPathData(data)}> get path</button>
			</div>
			)
	}
 }

export default Path;
